import 'react-awesome-slider/dist/styles.css';

class About extends Component {
  render() {
    return (
      <section className="custom_about" id="about">
        <Container>
          <Row>
            <Col md>
              <AwesomeSlider buttons="false">
                <div data-src="../images/background_img1.jpeg" />
                <div data-src="../images/background_img2.jpeg" />
                <div data-src="../images/background_img3.jpeg" />
              </AwesomeSlider>
            </Col>
            <Col md>  TEST TEST TEST TEST TEST TEST</Col>
          </Row>
        </Container>
      </section>
    );
  }
}
export default About;
